INSERT INTO `blogs` (`id`, `title`, `slug`, `description`, `excerpt`, `feature_img_name`, `feature_img_original_name`, `feature_img_mime`, `feature_img_ext`, `tags`, `categories`, `read`, `date`, `headline`, `front_slider`, `publish_status`, `seen`, `meta_title`, `meta_keywords`, `meta_description`, `addedby_id`, `editedby_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(17, 'স্বামী হিসেবে রোল মডেল', 'swamee-hisebe-rol-mdel', '<p>আগামী দশ বছরের মধ্যে যতোগুলি বিয়ে হবে। স্পেশিয়ালি যুবক বয়সে যে ছেলেগুলি এখন বিয়ে নিয়ে এতো পেরেশান, কেবল দ্বীন পূরণ এবং গুনাহমুক্ত থাকবার জন্য। ইন শা আল্লাহ, এরা ভবিষ্যতের রোল মডেল হবে। স্বামী হিসেবে রোল মডেল। সন্তানের আদর্শ বাবা হিসেবে রোল মডেল।&nbsp;</p><p>প্রিয়তমাকে, নিশ্চিত এরা আল্লাহ\'র জন্য খুব বেশি ভালবাসবে। খুব!</p><p>ওহ হ্যাঁ, আরেকটা প্রবণতা কাজ করবে, এরা কেবল দুনিয়াতে নয়, জান্নাতেও এদের প্রিয়তমা স্ত্রীকে হারাতে চাইবে না। তাহাজ্জুদে কেঁদেকেটে হলেও, জান্নাতের হুরদের সর্দারনী হিসেবে প্রিয়তমা স্ত্রীকে\'ই চাইবে।</p><p>খুব শীঘ্রই রাসূল(সাঃ) এর সুন্নাহ অনুসারী দম্পতিদের একটা মেলা বসবে। ইসলামের বিজয় মেলা, ইন শা আল্লাহ!&nbsp;</p><p>(ক্রিনশট নিয়ে রাখুন, দশ বছর পর এই হিসেব কষতে বসবো নিজের প্রিয়তমাকে পাশে বসিয়ে ইন শা আল্লাহ, যদি বেঁচে থাকি)</p>', 'প্রিয়তমাকে, নিশ্চিত এরা আল্লাহ\'র জন্য খুব বেশি ভালবাসবে। খুব!', 'lysLjlmh1645435032.jpg', 'sdxxxx.jpg', NULL, 'jpg', NULL, '2', 0, NULL, 0, 1, 'published', 387, 'ff', 'ff', 'ff', 4, 163, '2022-01-11 06:29:02', '2022-10-23 03:27:25', NULL),
(18, 'অভিমান হল ভালবাসার একটা অংশ অভিমানে ভালবাসা বাড়ে', 'oviman-hl-valbasar-ekta-ongs-ovimane-valbasa-bare', '<p>তুমি সুন্দর তাই চেয়ে থাকি সে কি মোর অপরাধা, অবশ্যই অপরাধ বউ না হলে, বউ হলে হবে সওয়াব।&nbsp;</p><p>&nbsp;আমি ১২ মাস তোমায় ভালোবাসি হে রব&nbsp; ।</p><p>প্রতিদিনই হবে পবিত্র ভালবাসা দিবস রজনী।</p><p>বিশ্বাস হয়না বুঝি তাহলে ছাড় দিন, ছেড়ে দিন, বাদ দিন, চুপ থাকুন, মেনে নিন, মানিয়ে নিন, চালিয়ে নিন, বলতে দিন, করতে দিন, সয়ে নিন। ব্যাস সুখ আসতে লাগবেনা আর বেশী দিন।&nbsp;</p><p>জাস্ট ওয়েট &amp; সি...</p><p>.</p><p>অভিমান হল ভালবাসার একটা অংশ অভিমানে ভালবাসা বাড়ে। রাগ হলো আগুন যা নিয়ন্ত্রিত হলে উপকারী, বেপরোয়া হলে ধ্বংসকারী। রেগে গেলন তো হেরে গেলেন।&nbsp;</p><p>বিঃ দ্রঃ= স্বামী বা স্ত্রী একে অপরের সাথে অন্যকোন পুরুষ বা নারীকে কখনো তুলনা করা উচিত না, এতে ভালবাসা কমে বাড়েনা। একে অপরকে রাজা রাণী মনে করবে। প্রত্যেকটি দম্পতিকে&nbsp;</p><p>অভিনন্দন</p><p>ভালবাসা অটুট থাকুন দুই দুনিয়ায়। অহেতুক সন্দেহ আর কুধারনায় আমাদের দাম্পত্য সম্পর্কগুলো শুধু নষ্ট নয় বিনষ্ট হয়ে যাচ্ছে।</p>', 'প্রতিদিনই হবে পবিত্র ভালবাসা দিবস রজনী।', 'hPvjafYG1645434306.jpg', 'asd.jpg', NULL, 'jpg', NULL, '2', 0, NULL, 0, 1, 'published', 440, 'dd', 'cx', 'xc', 4, 163, '2022-01-11 23:47:52', '2022-10-25 12:59:47', NULL),
(19, 'ঘরের বউ কেমন হওয়া উচিত ও আকর্ষনীয় হওয়া নেককাজ', 'ghrer-bu-kemn-hwa-ucit-oo-akrshneey-hwa-nekkaj', '<p>প্রতিটি মেয়ের উচিত সে তার স্বামীকে কেয়ার করবে। একজন মেয়ে যখন স্বামীকে যথেষ্ট কেয়ার করবে তখন স্বামীর মনে আপনা আপনিই সে স্ত্রী সবচেয়ে প্রিয় হয়ে জায়গা নিয়ে নিবে।</p><p><br></p><p>আধুনিক কালের এই সময় অনেক মেয়েকে দেখা যায় যারা বিয়ে বাড়ি বা অন্য কোন অনুষ্টানে নিজেকে এমন ভাবে সাজিয়ে তুলে যেন তার নতুন বিয়ে হচ্ছে। কিন্তু সে যখন রাতে স্বামীর সাথে সজ্জায় যায় তখন মনে হয় আস্ত একটা পেত্নী সাথে শুয়ে আছে।</p><p><br></p><p>হাসবেননা \" আমি বাস্তব কথা বলছি। যারা এর ভুক্তভোগী তারা আমাকে বার বার বলেছে। অনেক আলেম ওলামাও এ বিষয়ে বিরক্ত যে রাতে তাদের স্ত্রী তাদের সামনে সাজসজ্জা করেনা। বরং নোংরা কাপড় চোপড় নিয়ে শুয়ে থাকে।</p><p><br></p><p>সুন্নত হলো \" রাতে নতুন কাপড় পরিধান করা।</p><p><br></p><p>স্বামীর সুন্নত হলো সেও নিজেকে পরিস্কার ও আকর্ষনীয় ভাবে স্ত্রীকে তার কাছে আহবান করা। আল্লাহর নবী ( সাঃ) এটিকেও এবাদত বলেছেন। বলেছেন স্ত্রীকে প্রতিটি চুমুর বিনিময়ে একেকটি নেকির কথা।</p><p><br></p><p>আসুন \"যারা বিবাহিত\" তারা বিষয়গুলিতে মনোযোগ দেই। তাহলে হয়ে উঠবে আপনার জীবন দুনিয়াতেই জান্নাতের কিছুটা সুখময় নমুনা</p>', 'সুন্নত হলো \" রাতে নতুন কাপড় পরিধান করা।', 'FCviFrjb1645435174.jpg', '509x339.jpg', NULL, 'jpg', NULL, '2', 0, NULL, 0, 1, 'published', 403, 'ff', 'ff', 'ff', 4, 163, '2022-01-11 23:48:33', '2022-10-23 14:36:33', NULL),
(21, 'আপনার বিয়ে কখন ফরজ, যখন আপনি গুনাহে জড়িয়ে যাবার আশংকা করেন কিংবা জড়িয়ে যাচ্ছেন তখন আপনার জন্য বিয়ে ফরজ ধরে নিবেন', 'apnar-biye-kkhn-frj-zkhn-apni-gunahe-jriye-zabar-asngka-kren-kingba-jriye-zacchen-tkhn-apnar-jnz-biye-frj-dhre-niben', '<p><br></p><p>আপনার বিয়ে কখন ফরজ, যখন আপনি গুনাহে জড়িয়ে যাবার আশংকা করেন কিংবা জড়িয়ে যাচ্ছেন তখন আপনার জন্য বিয়ে ফরজ ধরে নিবেন। </p><p>আপনি ইসলাম মানছেন, বিয়ে যেহেতু ফরজ হয়ে পড়েছে আপনার জন্য তাই পরিবারকে জানাবেন কিভাবে? </p><p>মায়ের সাথে আন্তরিকতা তৈরি করুন, মায়ের সাথে বন্ধুত্ব সৃষ্টি করুন। </p><p>মায়ের সাথে কথা বলুন বেশি বেশি, সময় করে কথার মাঝে নিজের বোনদের বিয়ে নিয়ে গল্প করুন। </p><p>মায়ের কাজে সাহায্যের সময় কাজের ফাঁকে ফাঁকে কথা বলুন আর জানতে চান এলাকায় কোন কোন মেয়ের বিয়ে হয়ে গেছে আর কাদের হয়নি। </p><p><br></p><p>আপনার মা তখন ঠিক বুঝবে আপনার বিয়ে দেয়া দরকার কারণ প্রতিবেশী ভাবির মেয়েদের বিয়ে হয়ে গেছে তার মেয়েকেও দিতে হবে। </p><p><br></p><p>ঘন ঘন শাড়ি পড়ুন, বউ সাজুন আর মায়ের সামনে গিয়ে বলুন  দেখো তো আম্মু বউ সাজে আমাকে কেমন লাগছে। </p><p>মায়ের মনে ঠিক তখন আপনাকে বিয়ে দিয়ে বউ বানানোর চিন্তা আসবে। </p><p>বাবার সাথে কথা বলুন, তার সাথেও আন্তরিকতা তৈরি করুন, ভালো গল্প হতে পারে আপনি আপনার ছোটবেলার কথা তুলুন, বাবাকে বলুন – আগে ছোট থাকতে কত ঘুরতে নিয়ে গেছ বাবা এখন বড় হয়েছি একা হয়ে গেছি এখন নিয়ে যাও না। </p><p>বাবা বুঝবে তার সময় হয় না, কিন্তু মেয়ে বড় হয়েছে তার সঙ্গী দরকার। </p><p>বড় বোন বা ভাবি থাকলে তাদের সরাসরি বিয়ের কথা বলা যায়। </p><p>বেশি বেশি আপনার বান্ধবীর বিয়ের গল্প করতে পারেন আপনার মা কিংবা বোনের কাছে। </p><p>এভাবে করে মা বাবা বোনদের নজর আপনার বিয়ের দিকে নিতে পারেন। </p>', 'এভাবে করে মা বাবা বোনদের নজর আপনার বিয়ের দিকে নিতে পারেন।', 'KrOdBDUZ1651410406.jpg', 'a1.jpg', NULL, 'jpg', NULL, '2', 0, NULL, 0, 1, 'published', 418, 'a', 'a', 'sa', 4, 165, '2022-01-12 00:11:52', '2022-10-25 12:50:32', NULL);
