(4, 22, 'Terms and Conditions / Service Agreement', '<p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">Welcome to VIP Marriage Media , your trusted marriage media and marriage counselor in Bangladesh. This Agreement sets out the legally binding terms for your use of the Site and membership. This Agreement may be modified by its owner from time to time. The membership and rights of admissions are reserved.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">The website vipmarriagemedia.com .com is an advertising platform providing targeted advertising services for matchmaking alliances and replaces the traditional newspaper classified. The platform is for the personal use of individual members to advertise and promote their profiles for the purpose of finding relevant matches and cannot be used in connection with any commercial endeavors.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">The Site is a serious matchmaking platform to seek a life partner and is not a casual dating site.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">Access to the VIP Marriage Media website is free. However, we offer Several Membership packages wherein one can promote his/her Profile and at the same time we can assist him/her the best life partner.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">Some important terms of VIP Marriage Media&nbsp; are presented below for the convenience of customers to know and understand.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">In order to use the Service of VIP Marriage Media website, you must register as a member on the Website/ community sites/ mobile applications (\"site of the website\"). This Agreement is an electronic contract that establishes the legally binding terms you must accept to use the Site and to become a \"Member\" For purposes of this Agreement, the term \"Member\" means a person who voluntarily submits information to the Site whether such person uses the Service as a free member or a paid member.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">By using the Site, you agree to be bound by these Terms of Use (\"Agreement\"). If you wish to become a Member and promote/ advertise your profile to other Members and make use of the VIP Marriage Media service (\"Service\") read these Terms of Use and follow the instructions in the registration process. By using the Service, you consent to submit your personally identifiable information, to collect, process, and display and use the said information to provide the Service.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">To withdraw this consent, you must discontinue using our Service and delete your account.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">To register as a member of VIP Marriage Media or use this Site, you must be legally competent and of legal marriageable age as per the laws of Bangladesh (currently, 18 years or over for females and 21 years or over for males).</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">The VIP Marriage Media site is only to facilitate personal advertisement for a lawful marriage alliance between persons who are legally competent to enter into matrimony under the laws to which they are subject. Membership in the Service is void where prohibited.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">By using this Site, you represent and warrant that you have the right, consent, authority, and legal capacity to enter into this Agreement; submit relevant information to us; and that you are not prohibited or prevented by any applicable law for the time being in force or any order or decree or injunction from any court, tribunal or any such competent authority restraining you from entering into matrimony.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">You further confirm that you, intent to seek a life partner and that you shall not use this site for casual dating. You also agree to abide by all of the terms and conditions of this Agreement. If at any time VIP Marriage Media is of the opinion (in its sole discretion) or has any reason to believe that you are not eligible to become a member or that you have made any misrepresentation, vipmarriagemedia.com reserves the right to forthwith terminate your membership and/or your right to use the Service without any refund to you of any of your unutilized subscription fee.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:13.85pt;line-height:18.0pt;background:\r\n#F8F8F8\"><span style=\"font-size: 14px;\">Birth, death, marriage are in the hands of God Almighty, try us, the decision is yours. After all our efforts, it is your responsibility to accept whatever the outcome may be. Please refrain from abusing any customer, representatives of the organization. The rest of your life is the best time of your life.</span></p><div><br></div>', 1, 1, 4, 24, '2021-12-27 07:26:46', '2022-03-08 08:48:18'),
(5, 22, 'Acceptance of Terms of Use Agreement', '<div><span style=\"font-size: 14px;\">Welcome to VIP Marriage Media , your trusted marriage media and marriage counselor in Bangladesh. This Agreement sets out the legally binding terms for your use of the Site and membership. This Agreement may be modified by its owner from time to time. The membership and rights of admissions are reserved.</span></div><div><span style=\"font-size: 14px;\">The website vipmarriagemedia.com .com is an advertising platform providing targeted advertising services for matchmaking alliances and replaces the traditional newspaper classified. The platform is for the personal use of individual members to advertise and promote their profiles for the purpose of finding relevant matches and cannot be used in connection with any commercial endeavors.</span></div><div><span style=\"font-size: 14px;\">The Site is a serious matchmaking platform to seek a life partner and is not a casual dating site.</span></div><div><span style=\"font-size: 14px;\">Access to the VIP Marriage Media website is free. However, we offer Several Membership packages wherein one can promote his/her Profile and at the same time we can assist him/her the best life partner.</span></div><div><span style=\"font-size: 14px;\">Some important terms of VIP Marriage Media&nbsp; are presented below for the convenience of customers to know and understand.</span></div><div><span style=\"font-size: 14px;\"><br></span></div><div><span style=\"font-size: 14px;\">In order to use the Service of VIP Marriage Media website, you must register as a member on the Website/ community sites/ mobile applications (\"site of the website\"). This Agreement is an electronic contract that establishes the legally binding terms you must accept to use the Site and to become a \"Member\" For purposes of this Agreement, the term \"Member\" means a person who voluntarily submits information to the Site whether such person uses the Service as a free member or a paid member.</span></div><div><span style=\"font-size: 14px;\">By using the Site, you agree to be bound by these Terms of Use (\"Agreement\"). If you wish to become a Member and promote/ advertise your profile to other Members and make use of the VIP Marriage Media service (\"Service\") read these Terms of Use and follow the instructions in the registration process. By using the Service, you consent to submit your personally identifiable information, to collect, process, and display and use the said information to provide the Service.</span></div><div><span style=\"font-size: 14px;\">To withdraw this consent, you must discontinue using our Service and delete your account.</span></div><div><span style=\"font-size: 14px;\">To register as a member of VIP Marriage Media or use this Site, you must be legally competent and of legal marriageable age as per the laws of Bangladesh (currently, 18 years or over for females and 21 years or over for males).</span></div><div><span style=\"font-size: 14px;\">The VIP Marriage Media site is only to facilitate personal advertisement for a lawful marriage alliance between persons who are legally competent to enter into matrimony under the laws to which they are subject. Membership in the Service is void where prohibited.</span></div><div><span style=\"font-size: 14px;\">By using this Site, you represent and warrant that you have the right, consent, authority, and legal capacity to enter into this Agreement; submit relevant information to us; and that you are not prohibited or prevented by any applicable law for the time being in force or any order or decree or injunction from any court, tribunal or any such competent authority restraining you from entering into matrimony.</span></div><div><span style=\"font-size: 14px;\">You further confirm that you, intent to seek a life partner and that you shall not use this site for casual dating. You also agree to abide by all of the terms and conditions of this Agreement. If at any time VIP Marriage Media is of the opinion (in its sole discretion) or has any reason to believe that you are not eligible to become a member or that you have made any misrepresentation, vipmarriagemedia.com reserves the right to forthwith terminate your membership and/or your right to use the Service without any refund to you of any of your unutilized subscription fee.</span></div><div><span style=\"font-size: 14px;\">Birth, death, marriage are in the hands of God Almighty, try us, the decision is yours. After all our efforts, it is your responsibility to accept whatever the outcome may be. Please refrain from abusing any customer, representatives of the organization. The rest of your life is the best time of your life.</span></div><div><br></div>', 1, 0, 4, 24, '2021-12-27 07:31:12', '2022-03-08 08:47:21'),
(6, 22, 'Eligibility:', '<p>To register as a member of VIP Marriage Media or use this Site, you must be legally competent and of legal marriageable age as per the laws of Bangladesh (currently, 18 years or over for females and 21 years or over for males).</p><p>The VIP Marriage Media site is only to facilitate personal advertisement for a lawful marriage alliance between persons who are legally competent to enter into matrimony under the laws to which they are subject. Membership in the Service is void where prohibited.</p><p>By using this Site, you represent and warrant that you have the right, consent, authority, and legal capacity to enter into this Agreement; submit relevant information to us; and that you are not prohibited or prevented by any applicable law for the time being in force or any order or decree or injunction from any court, tribunal or any such competent authority restraining you from entering into matrimony.</p><p>You further confirm that you, intent to seek a life partner and that you shall not use this site for casual dating. You also agree to abide by all of the terms and conditions of this Agreement. If at any time VIP Marriage Media is of the opinion (in its sole discretion) or has any reason to believe that you are not eligible to become a member or that you have made any misrepresentation, vipmarriagemedia.com reserves the right to forthwith terminate your membership and/or your right to use the Service without any refund to you of any of your unutilized subscription fee.</p>', 0, 0, 4, 24, '2021-12-27 07:33:04', '2022-03-08 08:44:32'),
(7, 20, 'About US', '<div class=\"container\">\r\n                <div class=\"row my-5 \">\r\n\r\n                    <div class=\"col-12 col-md-3\">\r\n                        <div class=\"card\">\r\n                            <div class=\"image\">\r\n                                <img src=\"https://vipmarriagemedia.com/images/v1.jpg\" alt=\"\" class=\"img-fluid\">\r\n                            </div>\r\n                        </div>\r\n\r\n                    </div>\r\n                    <div class=\"col-12 col-md-9\">\r\n                        <div class=\"card\" style=\"border-radius:25px\">\r\n\r\n                            <div class=\"card-body\">\r\n                                <h3 class=\"mb-5\">About Us</h3>\r\n                                <div class=\"row\">\r\n                                    <div class=\"col-6 col-md-8\">\r\n\r\n                                        <p class=\"text-center\" style=\"line-height: 18px\"> With 15+ years of experience,\r\n                                            We are very selective and our focus is best matchmaking elite matrimony\r\n                                            service for eligible singles & affluent families in Bangladesh and other\r\n                                            countries who finding the finest matches. Our confidential Matrimonial\r\n                                            network of the most successful, educated, and most attractive Bachelors who\r\n                                            looking for perfect match. In Bangladesh and others countries.</p>\r\n                                        <p class=\"w3-text-sm mt-4\" style=\"line-height: 18px\"><small>You are part or Vip\r\n                                                matchmaking services till you get married . Vip experienced team will\r\n                                                handle all your communication between prospective matches behalf of you.\r\n                                   