(9, 19, '1) Introduction', '<p><span style=\"outline: 0px; font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Oxygen-Sans, Ubuntu, Cantarell, &quot;Helvetica Neue&quot;, sans-serif; font-weight: bolder; font-size: 18px; text-align: justify; word-spacing: 10px; background-color: rgb(247, 247, 247);\">vipmarriagemedia.com</span><span style=\"font-family: &quot;Arial Narrow&quot;, sans-serif, &quot;Times New Roman&quot;; font-size: 18px; text-align: justify; word-spacing: 10px; background-color: rgb(247, 247, 247);\">&nbsp;&nbsp;values the privacy of&nbsp;all of&nbsp;our users. This Privacy Statement will make you understand our information-handling practices. By registering or using our website,&nbsp;it means that you agree with our Privacy Policy.</span><br></p>', 1, 1, 4, NULL, '2021-12-27 08:25:57', '2021-12-27 08:25:57'),
(10, 19, '2) Information Provided To Us', '<p class=\"bgbd-font\" style=\"outline: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; background-color: rgb(247, 247, 247); font-family: &quot;Arial Narrow&quot;, sans-serif, &quot;Times New Roman&quot; !important; font-size: 18px !important; word-spacing: 10px !important; text-align: justify !important;\">You can browse our website without registering. But for enjoying certain features and services that we offer through the website need registration. For creating account, we ask for your real name, email address, password, and date of birth and phone number. During the profile creation process you submit all other personal information of your own accord which is available for public viewing. This information includes but is not limited to your gender, date of birth, contact details, educational qualification, employment details, photos, marital status, country, state, city, ethnicity and your interests etc...</p><p class=\"bgbd-font\" style=\"outline: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; background-color: rgb(247, 247, 247); font-family: &quot;Arial Narrow&quot;, sans-serif, &quot;Times New Roman&quot; !important; font-size: 18px !important; word-spacing: 10px !important; text-align: justify !important;\">You can browse our website without registering. But for enjoying certain features and services that we offer through the website need registration. For creating account, we ask for your real name, email address, password, and date of birth and phone number. During the profile creation process you submit all other personal information of your own accord which is available for public viewing. This information includes but is not limited to your gender, date of birth, contact details, educational qualification, employment details, photos, marital status, country, state, city, ethnicity and your interests etc...</p><p class=\"bgbd-font\" style=\"outline: 0px